import React from "react";

import Navbar from "../components/navbar";

export default function Editarusuario() {
  return (
    <>
      <Navbar />
      <div>
        <div className="container h-100">
          <div className="row">
            <div className="col-2"></div>
            <div className="col-8">
              <p className="fs-1">Editar usuario</p>
              <form></form>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
